import React from 'react';
import SkillsSection from '../Components/SkillsSection';
import Tittle from '../Components/Tittle';
import ImageSection from './ImageSection';

function AboutPage() {
    return (
        <div className="AboutPage">
            <Tittle title={'About Me'} span={'About Me'} />
            <ImageSection />
            <Tittle title={'My Skills'} span={'My Skills'} />
            <div className="skillsContainer">
                <SkillsSection skill={'Javascript'} progress={'60%'} width={'60%'} />
                <SkillsSection skill={'React Js'} progress={'30%'} width={'30%'} />
                <SkillsSection skill={'Node Js'} progress={'50%'} width={'50%'} />
                <SkillsSection skill={'Python'} progress={'40%'} width={'40%'} />
                <SkillsSection skill={'Web Design'} progress={'80%'} width={'80%'} />
                <SkillsSection skill={'UI/UX Design'} progress={'70%'} width={'70%'} />
                <SkillsSection skill={'Mongo DB'} progress={'40%'} width={'40%'} />
                <ServicesSection image={'design'}/>
            </div>
        </div>
    )
}

export default AboutPage;
